import sticker1 from "../../public/stickers/sticker1.png";
import sticker2 from "../../public/stickers/sticker2.png";
import sticker3 from "../../public/stickers/sticker3.png";
import { HeaderWrapper } from "../Shared/styles";
import { StickerWrapper, Wrapper } from "./styles";

export const MyCollection = () => {
  return (
    <Wrapper>
      <HeaderWrapper>
        <h2>My Stickers</h2>
      </HeaderWrapper>
      <StickerWrapper>
        <img src={sticker1} alt="sticker1" />
        <img src={sticker2} alt="sticker2" />
        <img src={sticker3} alt="sticker3" />
      </StickerWrapper>
    </Wrapper>
  );
};
